INSERT INTO `usedQuestions` VALUES(116, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'During an SPS test.', 'If the airspeed is less than 200 kts.', 'If one channel of the SPS is inoperative.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air leaving the pack is too hot.', 'The air entering the compressor is too hot.', 'The air leaving the compressor is too hot.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(117, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Pack 1 turns off.', 'Both packs turn off.', 'Both packs stay on.', 'Pack 2 turns off.', 'b');
