INSERT INTO `usedQuestions` VALUES(117, 35, 'mc', 'apu', 'In flight, the APU will shut down automatically for which of the following?', 'Fire.', 'Overspeed.', 'High oil temperature.', 'Overtemperature.', 'b');
INSERT INTO `usedQuestions` VALUES(117, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '-20 C', '40 C', '70 C', '54 C', 'a');
INSERT INTO `usedQuestions` VALUES(117, 52, 'tf', 'autopilot', 'The autopilot will not engage with the YD inoperative', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(117, 51, 'ac', 'autopilot', 'Which of the following will disconnect the autopilot?', 'The "AP" button on the Flight Guidance Control Panel', 'Use of pitch trim', 'The quick disconnect button', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(117, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Main cabin door only.', 'Over-wing emergency exit.', 'Main and service doors.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(117, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'Altitude displayed on each PFD differs by more than 200 feet.', 'A disagreement between IC-600''s on EICAS messages displayed.', 'IAS displayed on each PFD differs by more than 5 knots.', 'SG reversion has been selected.', 'b');
INSERT INTO `usedQuestions` VALUES(117, 87, 'mc', 'crew_awareness', 'The following messages appear during an AHRS 2 failure, prior to reversion:', 'SG 2', 'MAG 2, ATT 2.', 'ATT FAIL, HDG FAIL on PFD.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR approaches are impossible since the PFD is blank.', 'VOR (no DME) can be flown using the RMU navigation page', 'The FMS remains powered.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(117, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(117, 13, 'mc', 'elec', 'What items are available in essential power?', 'FMS1, DAU1B, DAU2B', 'SG2, DAU2B', 'RMU1, RMU2, EICAS and standby instruments.', 'FMS, PFD and MFDs.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 89, 'mc', 'elec', 'In flight, the NICAD batteries supply the electrical power for ___ minutes while on essential power.', '25 minutes.', '20 minutes.', '15 minutes.', '40 minutes.', 'd');
INSERT INTO `usedQuestions` VALUES(117, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', 'The Enhanced Emergency Master Kit (EEMK)', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'd');
INSERT INTO `usedQuestions` VALUES(117, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The engine bleed and lip anti-ice ice valves.', 'The fuel shutoff valve.', 'The hydraulic shutoff valve to the engine-driven hydraulic pump.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(117, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Fire extinguishing handle - PULL & ROTATE.', 'Thrust lever - IDLE.', 'Start/Stop Selector - STOP.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(117, 132, 'mc', 'flt_control', 'The EICAS message "FLAP LOW SPEED"...', 'Indicates a failure of the teleflex cable.', 'Indicates a failure of the flap velocity sensor.', 'Indicates a flap motor failure.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 118, 'mc', 'flt_control', 'When using speedbrakes in flight:', 'The outboard spoilers deploy using hydraulic system 2 pressure.', 'The inboard spoilers deploy using hydraulic system 1 pressure.', 'The inboard and outboard spoilers deploy using both systems.', 'The outboard spoilers deploy using hydraulic system 1 pressure.', 'a');
INSERT INTO `usedQuestions` VALUES(117, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'One wing tank reaches 4630 lbs + 30 seconds.', 'The FMS shows fuel remaning on arrival of less thank 1800 lbs.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Turn the pump in the low tank off.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 145, 'mc', 'hydraulics', 'The hydraulic accumulator #2 alone can supply the:', 'Outboard spoilers, inboard brakes, emergency brakes.', 'Emergency brakes only, unlimited applications.', 'Inboard spoilers, outboard brakes, landing gear.', 'Emergency brakes only, supplying 6 applications.', 'd');
INSERT INTO `usedQuestions` VALUES(117, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Both hydraulic systems.', 'Hydraulic system 2 only, when above 135 KIAS.', 'Hydraulic system 1 only.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(117, 158, 'mc', 'ice_rain_prot', 'The SPS/ICE SPEEDS EICAS message is cleared:', 'By pressing the quick disconnect button.', 'By pressing the SPS test button at any time.', 'Once the aircraft exits icing conditions.', 'By pressing the SPS test button (on the ground only).', 'd');
INSERT INTO `usedQuestions` VALUES(117, 162, 'nc', 'ice_rain_prot', 'Engine lip anti-ice:', 'Uses bleed air from the 9th stage of the compressor.', 'Cannot be activated unless ice is detected.', 'Fails closed (OFF) in essential power.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(117, 163, 'mc', 'ice_rain_prot', 'To perform the A ice protection test:', 'Only engine bleed air may be used.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'All three bleed valves must be closed.', 'The engine thrust must be at a minimum of 83% N1.', 'a');
INSERT INTO `usedQuestions` VALUES(117, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'They are never inhbited.', 'With the FADEC Ref. anti-ice selected OFF.', 'On the ground with a wheel speed at or below 25 kts.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 189, 'mc', 'ldg_gear_brk', 'Nosewheel steering utilizes:', 'Is electropneumatic.', 'Hydraulic system 1.', 'Both hydraulic systems.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(117, 175, 'mc', 'ldg_gear_brk', 'The nose wheel air/ground sensor provides a signal for:', 'The pressurization system to begin pressurizing during takeoff.', 'Removal of ground inihibtion for the weather radar.', 'Activating nosewheel steering.', 'The nose wheel doors to close.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 201, 'mc', 'lighting', 'What is the power source for the emergency lighting system on the 145 EP/LR?', 'Essential bus.', 'DC bus.', 'Dedicated batteries.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 194, 'mc', 'lighting', 'Charging the XR photo luminescent aisle lights is the responsibility of the:', 'Gate agent.', 'They no longer need to be charged.', 'Flight crew.', 'Maintenance.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL300.', 'FL370.', 'FL200.', 'FL350.', 'a');
INSERT INTO `usedQuestions` VALUES(117, 207, 'mc', 'limitations', 'While descending through 10,000 ft, you notice the LP spool vibration on engine 1 is in the amber.  After running the appropriate QRH, when must the engine be shutdown?', 'It doesn''t.', '10 seconds.', '1 minute.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(117, 219, 'mc', 'limitations', 'The maximum load on the APU generator above FL300 is:', '250 amps.', '400 amps.', '350 amps.', '300 amps.', 'd');
INSERT INTO `usedQuestions` VALUES(117, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Only if the crossfeed is on.', 'Yes.', 'No.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(117, 215, 'mc', 'limitations', 'What is VLE?', '250 knots.', '180 knots.', '200 knots below 10,000 and 180 knots when above 10,000.', '200 knots.', 'a');
INSERT INTO `usedQuestions` VALUES(117, 231, 'mc', 'oxy', 'In the XR with passenger oxygen masks in AUTO, the oxygen masks drop at:', '14,500'' +/- 500 cabin altitude.', '14,000'' AGL.', '14,000'' MSL.', '10,000'' cabin altitude.', 'a');
INSERT INTO `usedQuestions` VALUES(117, 227, 'mc', 'oxy', 'The passenger oxygen system includes:', 'Demand flow masks.', 'Two oxygen bottles, which supply the passenger oxygen masks.', 'Oxygen generators.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line and an OPEN inscription.', 'Open inscription, no line.', 'A line, no OPEN inscription.', 'No line, no open inscription.', 'c');
INSERT INTO `usedQuestions` VALUES(117, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves close.', 'The APU bleed valve closes.', 'Both valves can be open at the same time.', 'The engine bleed valve closes.', 'b');
