INSERT INTO `usedQuestions` VALUES(117, 260, 'mc', 'powerplant', 'The FADECs receive electrical power from:', 'The PMA only.', 'The essential buses.', 'The essential buses during an electrical emergency.', 'The essential buses or the PMA depending on N2 RPM.', 'd');
INSERT INTO `usedQuestions` VALUES(117, 262, 'mc', 'powerplant', 'During an engine start, fuel should be introduced at...', '56.4 percent N2.', 'Immediately after IGN is displayed on the EICAS.', '12-14 percent N2.', 'Approximately 30 percent N2.', 'd');
