INSERT INTO `usedQuestions` VALUES(117, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'The static/pressurization ports.', 'Pitot/static tube 3.', 'Static ports 1 and 4.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(117, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'At 130 KIAS.', 'A and B are correct.', 'd');
